import { Link } from "react-router-dom";

const CategoryNavigator = (category) => {
  return (
    <Link
      to={`/home/product/category/${category.item.id}/${category.item.title}`}
      style={{
        textDecoration: "none",
        color: "chocolate",
      }}
    >
      <i>{category.item.title}</i>
    </Link>
  );
};

export default CategoryNavigator;
